import Input from "./Input";

export default function Postment() {
  return (
    <div>
      <form style={{ border: "1px" }}>
        <input type="text" placeholder="username" />
        <textarea type="text" placeholder="content" />
        <button style={{ marginTop: "20px" }} type="submit">
          Post
        </button>
      </form>
    </div>
  );
}
